import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';


// 定义
const HistoryPage = Loadable({
  loader: () => import('layouts/WorkManage/HistoryPage'),
  loading: LoadingComponent
});
// 库存
const ListPage = Loadable({
  loader: () => import('layouts/WorkManage/ListPage'),
  loading: LoadingComponent
});
// 详情
const OperatePage = Loadable({
  loader: () => import('layouts/WorkManage/OperatePage'),
  loading: LoadingComponent
});

export {
  HistoryPage,ListPage,OperatePage
};
